import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Attempt XSS via search input
    const xssPayload = '<script>alert("XSS")</script>';
    await page.fill('#searchInput', xssPayload); // Using ID selector
    await page.click('.search-btn'); // Using class selector

    // Take screenshot after interaction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_input.png'));

    // Verify if the payload was executed (check for alert)
    const alertExists = await page.evaluate(() => {
      return !!document.querySelector('script');
    });

    return {
      success: true,
      action: "Attempted XSS via search input",
      extractedData: { alertExists },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
